  o dediğiniz artık bu ülkede geçerli değil avrupadan 2014 getirdikleri ecnebi sözleşmesi olan istanbul sözleşmesi ve 6284 yasasından  destek alan feminist kadın dernekleri ve lgbt eliyle o kaleler paramparça edilmiş yıkılmış viraneye çevirilmiştir üzgünüm

Iyi  yayınlar  muhalefet  diye sadece chp ve iyi parti yı görme  anlayışından  vazgeçin artık  , HDP nin istanbul sözleşmesi  ile ilgili açıklamaları  ve eylemlerini görmemek  ne ile  açıklanır. 
